import './CreateEvent.css';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const EventPage = () => {
  const navigate = useNavigate();
  const [values, setValues] = useState({
    title: '',
    description: '',
    photo: '',
    date: '',
    startTime: '',
    endTime: '',
    location: '',
    user_id: '',
  });

  return (
    <div className="eventPage">
      <div className="eventBox">
        meow meow meow meow
          <div className="leftEventBox">
            <img className='eventPageImage' />
            <text className='eventTitle'/>
            <text className='eventDescription'/>
          </div>
          <div className="rightEventBox">
            <div className='userProfile'>
                this will display user information
            </div>
            <text className='eventDay'/>
            <text className='eventTime'/>
          </div>
      </div>
    </div>
  );
};

export default EventPage;
